  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:15.334218\",\n\t\"name\": \"mackay-island-national-wildlife-refuge-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Mackay Island NWR for the next 15 years. This
  plan outlines the Refuge vision and purpose and describes how Mackay Island NWR
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the Refuge, an overview of the CCP process, information about plan
  development and the management direction, and strategies for implementation. Key
  planning issues include: hydrology, global warming, fish and wildlife populations,
  habitats, public use, resource protection, and wilderness review.\",\n\t\"license_title\":
